import React from "react";
import styles from "./DisplayClass.module.css";

function DisplayClass(props) {
  const { result } = props;

  // class_name
  // teacher_name
  // class_prerequisites
  // class_description
  // subject

  return (
    <div className={styles.cards}>
      {result.class_name}
      <div className={`${styles["card-1"]} ${styles.card}`}>
        <h2 className={styles["card__title"]}>{result.class_name}</h2>
        <h2 className={styles["card__title"]}>{result.teacher_name}</h2>
        {/* <h2 className={styles["card__title"]}>{result.class_prerequisites}</h2> */}
        <p className={styles["card__apply"]}>
          <button className={styles["card_btn"]} href="#">
            Apply Now
          </button>
        </p>
      </div>
    </div>
  );
}

export default DisplayClass;
